const ProductCatalog = [
  {
    item: "A",
    unitPrice: 0.5,
    offer: { quantity: 3, specialPrice: 1.3 },
  },
  {
    item: "B",
    unitPrice: 0.3,
    offer: { quantity: 2, specialPrice: 0.45 },
  },
  {
    item: "C",
    unitPrice: 0.2,
    offer: null,
  },
  {
    item: "D",
    unitPrice: 0.15,
    offer: null,
  }
];

export default ProductCatalog;
